  \"2015-08-21T22:53:37.437061\",\n\t\"name\": \"va-personal-health-record-non-identifiable-data\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"My HealtheVet (www.myhealth.va.gov ) is
  a Personal Health Record portal designed to improve the delivery of health care
  services to Veterans, to promote health and wellness, and to engage Veterans as
  more active participants in their health care. The My HealtheVet portal enables
  Veterans to create and maintain a web-based PHR that provides access to patient
  health education information and resources, a comprehensive personal health journal,
  and electronic services such as online VA prescription refill requests and Secure
  Messaging. Veterans can visit the My HealtheVet website and self-register to create
  an account, although registration is not required to view the professionally-sponsored
  health education resources, including topics of special interest to the Veteran
  population. Once registered, Veterans can create a customized PHR that is accessible
  from any computer with Internet access.\",\n\t\"license_title\": \"Creative Commons
